function Home() {
  return (
    <div className="hero">
      <h1>Welcome to ThinkStack Hackathon</h1>
      <p>Submit your innovative projects and compete for the top spot!</p>
      <a href="/register" className="btn btn-light btn-lg">Register Now</a>
    </div>
  );
}

export default Home;
